import { useState, useEffect } from "react";
import { Card, CardContent } from "./components/ui/card.js";
import { Button } from "./components/ui/button.js";
import { Select, SelectTrigger, SelectValue, SelectContent, SelectItem } from "./components/ui/selects.js";
import axios from "axios";

export default function App() {
  const [categories, setCategories] = useState([]); // Chuyển từ {} -> [] để tránh lỗi map()
  const [selectedImage, setSelectedImage] = useState(null);
  const [modelType, setModelType] = useState("cnn");
  const [prediction, setPrediction] = useState(null);

  // Fetch dữ liệu danh mục từ API
  useEffect(() => {
    axios.get("http://localhost:5000/categories")
      .then((res) => {
        console.log("Categories Data:", res.data); // Debug
        setCategories(res.data);
      })
      .catch((err) => console.error("Error fetching categories:", err));
  }, []);

  // Xử lý dự đoán hình ảnh
  const handlePredict = async () => {
    if (!selectedImage) return;

    try {
      const response = await axios.post("http://localhost:5000/predict", {
        image_url: selectedImage,
        model_type: modelType,
      });
      setPrediction(response.data);
    } catch (error) {
      console.error("Prediction error:", error);
    }
  };

  return (
    <div className="p-4 max-w-4xl mx-auto">
      <h1 className="text-2xl font-bold mb-4">CIFAR-10 Image Classifier</h1>

      {/* Hiển thị danh mục hình ảnh */}
      <div className="grid grid-cols-2 md:grid-cols-5 gap-4">
        {Array.isArray(categories) && categories.length > 0 ? (
          categories.map((category) => (
            <Card key={category.name}>
              <CardContent className="p-2">
                <h2 className="text-lg font-semibold">{category.name}</h2>
                <div className="grid grid-cols-3 gap-1 mt-2">
                  {category.images.slice(0, 6).map((img) => (
                    <img
                      key={img}
                      src={`http://localhost:5000/image/${category.name}/${img}`}
                      alt={img}
                      className="w-full h-16 object-cover cursor-pointer"
                      onClick={() => setSelectedImage(`http://localhost:5000/image/${category.name}/${img}`)}
                    />
                  ))}
                </div>
              </CardContent>
            </Card>
          ))
        ) : (
          <p className="text-gray-500">No categories found.</p>
        )}
      </div>

      {/* Hiển thị ảnh đã chọn */}
      <div className="mt-4">
        <h2 className="text-xl font-semibold">Selected Image</h2>
        {selectedImage && <img src={selectedImage} alt="Selected" className="w-32 h-32 mt-2" />}
      </div>

      {/* Chọn mô hình AI */}
      <div className="mt-4">
        <Select value={modelType} onValueChange={setModelType}>
          <SelectTrigger className="w-[180px]">
            <SelectValue placeholder="Select Model" />
          </SelectTrigger>
          <SelectContent>
            <SelectItem value="cnn">CNN</SelectItem>
            <SelectItem value="resnet">ResNet</SelectItem>
            <SelectItem value="vgg">VGG</SelectItem>
          </SelectContent>
        </Select>
      </div>

      {/* Nút dự đoán */}
      <Button onClick={handlePredict} className="mt-4">Predict</Button>

      {/* Hiển thị kết quả dự đoán */}
      {prediction && (
        <div className="mt-4 p-4 bg-gray-100 rounded">
          <h2 className="text-lg font-semibold">Prediction Result:</h2>
          <p>Class: {prediction.class_name}</p>
          <p>Confidence: {(prediction.confidence * 100).toFixed(2)}%</p>
        </div>
      )}
    </div>
  );
}
